import React from 'react';
import './App.css';
import Header from './Components/Header';
import Home from './Components/Home';
import Detail from './Components/Detail';
import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
    <Router>
      <Header />
      <Switch>
        <Route path="detail">
          <Detail /> 
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>

      <Home />
    </div>
  );
}

export default App;
